import React from 'react';


class Jobs extends React.Component{

    async componentDidMount(){
        let jobs = await fetch('https://jobs.github.com/positions.json?lat=20.5937&&long=78.9629search=react',{
            method:'get'
        });

        let jobsArray = await jobs.json();
        console.log(jobsArray);
    }
    render(){
        return(
            <div className="jobs">

            </div>
        )
    }

}

export default Jobs;
